window.bookSummaryJSON = "<p>Uninhibited. Sarcastic. Confident. Beautiful. With a thriving photography career that allows her to travel all over the world and capture the hottest of men behind her camera lens, Cassie Phillips is the woman who can't be tamed. </p> <p>Adrenaline junkie. Jokester. Billionaire. Hot as sin. At six-foot-five, with muscles for days and that perfect, playful smile, Thatcher Kelly is the kind of man you don't want to deny. </p> <p>Wild for wild. Prank for prank. The two most unlikely of people may be the only ones to see that some personality traits only run skin deep. </p> <p>Uncensored. Hilarious. And too damn hot to put into words. Grab a fan and get ready for one hell of a ride, because when the opposite of opposites attract, things are bound to get a little messy. </p>"; 
